import "./App.css";
import React, { useState } from "react";
import ChildComponent from "./Components/ChildComponent";
import Product from "./Components/Product";

function App() {
  let product = [
    { id: 1, name: "Argen 0", price: "1500$" },
    { id: 2, name: "Argen 1", price: "1600$" },
    { id: 3, name: "Argen 2", price: "1700$" },
    { id: 4, name: "Argen 3", price: "1800$" },
    { id: 5, name: "Argen 4", price: "1900$" },
    { id: 6, name: "Argen 6", price: "2500$" },
    { id: 7, name: "Argen 7", price: "3500$" },
  ];

  return (
    <div className="App">
      <ChildComponent message={23} title={"halid"} id={1} />
      <ChildComponent message={"Hello world"} title={"Apple"} id={2} />
      <ChildComponent message={"Argen"} title={"Samsung"} id={3} />
      <ChildComponent message={"Akylai"} title={"Osh"} id={4} />

      {product.map((item) => (
        <Product key={item.id} id={item.id} name={item.name} price={item.price} />
      ))}

      <Product />
    </div>
  );
}

export default App;
